import React from 'react';

const style = {
  nav: `bg-green-500 h-20 flex justify-between items p-4`,
  heading: `text-white text-3xl`,
  fontStyle: `font-sans`,
};

const Navbar = () => {
  return (
    <div className={style.nav.style.fontStyle}>
      <h1 className={style.heading}>Ayo Chat</h1>
    </div>
  );
};

export default Navbar;
